export default [

    // HEMSTÄD
    // ALLRUM/VARDAGSRUM


    {
        text: "Torka eluttag, lister, trösklar, fönsterbrädor, bord, lampor, hyllor"
    },
    {
        text: "Putsa speglar"
    },
    {
        text: "Vik pläder, puffa kuddar, lägg i ordning tidningar, fjärrkontroller mm"
    },
    {
        text: "Dammsug soffa ovanpå (lyft ej dynor)"
    },
]
